import '../Assets/Styles/Header.css';
import Logo from '../Assets/Images/logo.png';

function Header() {
    return(
        <div className='header'>
            <div className='logoContainer'>
                <img className='logo' src={Logo} alt='Logo'/>
            </div>
            <p>Dashboard</p>
        </div>
    );
}

export default Header
